import React from 'react'
import { FaPlus } from 'react-icons/fa'
export default function AddUser() {
  return (
	<div className='text-4xl p-10 font-mono w-full text-md font-medium transition-all'>
	 	<p className='p-10 text-white'>Usuarios</p> 
			<button className="flex flex-row items-center space-x-2 text-white text-xl">
				<FaPlus />
				<span>Add User</span>
			</button>
	</div>
  )
}
